(15, 'Hệ thống y tế MEDLATEC', '42 Nghĩa Dũng, Phúc xá, Ba Đình, Hà Nội', 'BookingCare là Nền tảng Y tế chăm sóc sức khỏe toàn diện hàng đầu Việt Nam kết nối người dùng với trên 200 bệnh viện - phòng khám uy tín, hơn 1,500 bác sĩ chuyên khoa giỏi và hàng nghìn dịch vụ, sản phẩm y tế chất lượng cao.\n\nHãy đặt lịch với Hệ thống y tế MEDLATEC trên Nền tảng Y tế Chăm sóc sức khỏe toàn diện BookingCare:\n\n*   Được lựa chọn dịch vụ y tế chất lượng\n*   Đặt hẹn trực tuyến & nhận hướng dẫn chi tiết trước khi đến (miễn phí)\n*   Giảm thiểu thời gian chờ đợi', '<p>BookingCare là Nền tảng Y tế chăm sóc sức khỏe toàn diện hàng đầu Việt Nam kết nối người dùng với trên 200 bệnh viện - phòng khám uy tín, hơn 1,500 bác sĩ chuyên khoa giỏi và hàng nghìn dịch vụ, sản phẩm y tế chất lượng cao.</p>\n<p>Hãy đặt lịch với Hệ thống y tế MEDLATEC trên Nền tảng Y tế Chăm sóc sức khỏe toàn diện BookingCare:</p>\n<ul>\n<li>Được lựa chọn dịch vụ y tế chất lượng</li>\n<li>Đặt hẹn trực tuyến &amp; nhận hướng dẫn chi tiết trước khi đến (miễn phí)</li>\n<li>Giảm thiểu thời gian chờ đợi</li>\n</ul>\n', , '2023-06-06 15:25:17', '2023-06-06 15:25:17');
