(17, 'Hệ thống Y tế Thu Cúc TCI', 'Cơ sở Nguyễn Trãi: 136 Nguyễn Trãi, Thanh Xuân, Hà Nội', 'BookingCare là Nền tảng Y tế chăm sóc sức khỏe toàn diện hàng đầu Việt Nam kết nối người dùng với trên 200 bệnh viện - phòng khám uy tín, hơn 1,500 bác sĩ chuyên khoa giỏi và hàng nghìn dịch vụ, sản phẩm y tế chất lượng cao.\nHãy đặt lịch khám với Hệ thống Y tế Thu Cúc TCI trên Nền tảng Y tế Chăm sóc sức khỏe toàn diện BookingCare:\n\nĐược lựa chọn khám với các bác sĩ chuyên khoa giàu kinh nghiệm\nHỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch) \nKhám theo giờ hẹn, giảm thiểu thời gian chờ đợi xếp hàng\nNhận được hướng dẫn đi khám chi tiết sau khi đặt lịch', '<p>BookingCare là Nền tảng Y tế chăm sóc sức khỏe toàn diện hàng đầu Việt Nam kết nối người dùng với trên 200 bệnh viện - phòng khám uy tín, hơn 1,500 bác sĩ chuyên khoa giỏi và hàng nghìn dịch vụ, sản phẩm y tế chất lượng cao.\nHãy đặt lịch khám với Hệ thống Y tế Thu Cúc TCI trên Nền tảng Y tế Chăm sóc sức khỏe toàn diện BookingCare:</p>\n<p>Được lựa chọn khám với các bác sĩ chuyên khoa giàu kinh nghiệm\nHỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch)\nKhám theo giờ hẹn, giảm thiểu thời gian chờ đợi xếp hàng\nNhận được hướng dẫn đi khám chi tiết sau khi đặt lịch</p>\n', , '2023-06-06 15:26:29', '2023-06-06 15:26:29');
