a (skincare)  cho viêm da mặt, trứng cá, liệu trình trị nám, lăn kim, huyết tương giàu tiểu cầu, trị sẹo trứng cá, laser, plasma trị u lành da, nám, đồi mồi\n* Tiêm tái sinh nang tóc\n\n![img](https://vietluat.vn/wp-content/uploads/2020/12/Thanh-lap-phong-kham-da-khoa-1-711x400.jpg?raw=true)\n', 'Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương Bác sĩ từng công tác tại Bệnh viện Da liễu Trung ương Nguyên Tổng Thư ký Hiệp hội Da liễu Việt Nam.\nBác sĩ từng công tác tại Bệnh viện Da liễu Trung ương\nNguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương\nĐạt chứng chỉ Diploma về Da liễu', 28, NULL, NULL, '2023-04-23 02:29:11', '2023-06-14 23:54:26'),
