INSERT INTO `specialties` (`id`, `name`, `image`, `descriptionHTML`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(10, 'Sản phụ khoa', , '<h1>Sản Phụ khoa</h1>\n<h2><strong>Bác sĩ Sản phụ khoa</strong></h2>\n<p>BookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa sản giỏi tại Hà Nội.</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Sản phụ khoa tại Hà Nội</li>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Phụ sản Trung ương, Bệnh viện Phụ sản Hà Nội, Khoa Sản - Bệnh viện Bạch Mai.</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>\n<p>Rối loạn kinh nguyệt, chậm kinh, đau bụng kinh</p>\n</li>\n<li>\n<p>Tắc hai vòi trứng, Đa nang buồng trứng, Chụp vòi trứng,</p>\n</li>\n<li>\n<p>Khám hiếm muộn, vô sinh</p>\n</li>\n<li>\n<p>Khám Phụ Khoa</p>\n</li>\n<li>\n<p>Khám thai sản</p>\n</li>\n<li>\n<p>Khám tiền hôn nhân, Tiền sinh</p>\n</li>\n<li>\n<p>Kiểm tra phụ khoa</p>\n</li>\n<li>\n<p>Loạn dưỡng vú</p>\n</li>\n<li>\n<p>Rong kinh kéo dài</p>\n</li>\n<li>\n<p>Siêu âm thai định kỳ</p>\n</li>\n<li>\n<p>Thai lưu</p>\n</li>\n<li>\n<p>U xơ tử cung, Viêm lộ tuyến</p>\n</li>\n<li>\n<p>...</p>\n</li>\n</ul>\n', '# Sản Phụ khoa\n\n## **Bác sĩ Sản phụ khoa**\n\nBookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa sản giỏi tại Hà Nội.\n\n*   Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Sản phụ khoa tại Hà Nội\n*   Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Phụ sản Trung ương, Bệnh viện Phụ sản Hà Nội, Khoa Sản - Bệnh viện Bạch Mai.\n\n**Khám và điều trị**  \n\n*   Rối loạn kinh nguyệt, chậm kinh, đau bụng kinh   \n*   Tắc hai vòi trứng, Đa nang buồng trứng, Chụp vòi trứng,       \n*   Khám hiếm muộn, vô sinh     \n    \n*   Khám Phụ Khoa\n*   Khám thai sản\n*   Khám tiền hôn nhân, Tiền sinh   \n*   Kiểm tra phụ khoa     \n    \n*   Loạn dưỡng vú\n*   Rong kinh kéo dài     \n    \n*   Siêu âm thai định kỳ\n*   Thai lưu  \n    \n*   U xơ tử cung, Viêm lộ tuyến\n*   ...', '2023-05-30 16:58:41', '2023-05-30 16:58:41');
INSERT INTO `specialties` (`id`, `name`, `image`, `descriptionHTML`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(11, 'Siêu âm thai', , '<h1>Siêu âm thai</h1>\n<h2><strong>Bác sĩ Siêu âm thai</strong></h2>\n<p>BookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa sản - siêu âm thai giỏi tại Hà Nội.</p>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Phụ sản Trung ương, Bệnh viện Phụ sản Hà Nội, Khoa Sản - Bệnh viện Bạch Mai.</p>\n<h2><strong>Khám và điều trị</strong></h2>\n<p>Dưới đây là một số vấn đề thường gặp mà các bác sĩ siêu âm thai thường khám và điều trị</p>\n<ul>\n<li>\n<p>Khám thai sản</p>\n</li>\n<li>\n<p>Khám thai lần đầu</p>\n</li>\n<li>\n<p>Siêu âm thai định kỳ</p>\n</li>\n<li>\n<p>Siêu âm thai tuần thứ 12</p>\n</li>\n<li>\n<p>Siêu âm thai tuần thứ 16</p>\n</li>\n<li>\n<p>Siêu âm thai tuần thứ 18</p>\n</li>\n<li>\n<p>Siêu âm thai tuần thứ 22</p>\n</li>\n</ul>\n', '# Siêu âm thai\n\n## **Bác sĩ Siêu âm thai**\n\nBookingCare cung cấp thông tin và lịch khám của các bác sĩ chuyên khoa sản - siêu âm thai giỏi tại Hà Nội.\n\nCác chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội như: Bệnh viện Phụ sản Trung ương, Bệnh viện Phụ sản Hà Nội, Khoa Sản - Bệnh viện Bạch Mai.\n\n## **Khám và điều trị**\n\nDưới đây là một số vấn đề thường gặp mà các bác sĩ siêu âm thai thường khám và điều trị\n\n*   Khám thai sản\n*   Khám thai lần đầu\n*   Siêu âm thai định kỳ\n*   Siêu âm thai tuần thứ 12  \n    \n*   Siêu âm thai tuần thứ 16\n*   Siêu âm thai tuần thứ 18\n*   Siêu âm thai tuần thứ 22', '2023-05-30 16:59:06', '2023-05-30 16:59:06');
INSERT INTO `specialties` (`id`, `name`, `image`, `descriptionHTML`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(12, 'Nhi khoa', , '<h1>Nhi khoa</h1>\n<h2>**Bác sĩ chuyên khoa Nhi **</h2>\n<p>Danh sách bác sĩ chuyên khoa Nhi giỏi:</p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội</li>\n<li>Các giảng viên đã và đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như: Bệnh viện Nhi Trung ương, Khoa Nhi - Bệnh viện Bạch Mai.</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>Bệnh lý sơ sinh</li>\n<li>Bệnh tiêu hóa</li>\n<li>Bệnh tuần hoàn</li>\n<li>Bệnh hô hấp</li>\n<li>Bệnh huyết học</li>\n<li>Bệnh thận Tiết niệu</li>\n<li>Bệnh thần kinh</li>\n<li>Bệnh ngoài da</li>\n<li>Bệnh xương khớp</li>\n</ul>\n', '# Nhi khoa\n\n## **Bác sĩ chuyên khoa Nhi **\n\nDanh sách bác sĩ chuyên khoa Nhi giỏi:\n\n*   Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn tại Hà Nội\n*   Các giảng viên đã và đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội\n*   Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như: Bệnh viện Nhi Trung ương, Khoa Nhi - Bệnh viện Bạch Mai.\n\n**Khám và điều trị**\n\n*   Bệnh lý sơ sinh\n*   Bệnh tiêu hóa\n*   Bệnh tuần hoàn\n*   Bệnh hô hấp\n*   Bệnh huyết học\n*   Bệnh thận Tiết niệu\n*   Bệnh thần kinh\n*   Bệnh ngoài da\n*   Bệnh xương khớp', '2023-05-30 16:59:34', '2023-05-30 16:59:34');
